import React from "react";
import { Col, Row, Container } from "../components/Grid";

const PrintReceipt = () => {
  return (
    <Container fluid>
      <h1>Print receipts</h1>
      <br />
      <a href="/home">Home</a>
    </Container>
  );
};

export default PrintReceipt;
